    { id: 2, title: 'Javascript', body: 'Description' },
    { id: 3, title: 'Javascript', body: 'Description' },
    { id: 4, title: 'Javascript', body: 'Description' },
    { id: 5, title: 'Javascript', body: 'Description' },

  ])

  return (
    <div className="App">
      {/* <Counter/> */}
      {posts.map((post)=> 
      <PostItem post= {post} key={post.id}/>
      )}

    </div>
  );
};

export default App;
